"   <div class=\"block pha drugH1Div\" id=\"F229837\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Forms a reversible complex that displaces plasminogen from fibrin resulting in inhibition of fibrinolysis; it also inhibits the proteolytic activity of plasmin",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;\">",
"     With reduction in plasmin activity, tranexamic acid also reduces activation of complement and consumption of C1 esterase inhibitor (C1-INH), thereby decreasing inflammation associated with hereditary angioedema.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F229852\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : 9-27 L",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: ~3%, primarily to plasminogen",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: Oral:  ~45%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: ~2-11 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: Oral: ~3 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (&gt;95% as unchanged drug)",
"    </p>",
"   </div>",
