var title_f13_58_14251="Histol grading post preop chemo";
var content_f13_58_14251=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F58829&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F58829&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Histologic grading of the effect of preoperative chemotherapy on primary osteosarcoma",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Grade",
"       </td>",
"       <td class=\"subtitle1\">",
"        Effect",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        I",
"       </td>",
"       <td>",
"        Little or no effect identified",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        II",
"       </td>",
"       <td>",
"        Areas of acellular tumor osteoid, necrotic, or fibrotic material attributable to the effect of chemotherapy, with other areas of histologically viable tumor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        III",
"       </td>",
"       <td>",
"        Predominant areas of acellular tumor osteoid, necrotic, or fibrotic material attributable to the effect of chemotherapy, with only scattered foci of histologically viable tumor cells identified",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        IV",
"       </td>",
"       <td>",
"        No histologic evidence of viable tumor identified within the entire specimen",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Rosen G, et al. Primary osteogenic sarcoma: eight year experience with adjuvant chemotherapy. J Cancer Res Clin Oncol 1983; 106 (suppl):55. Copyright &copy; 1983 Springer-Verlag.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
