"    <div class=\"reference\">",
"     Reproduced with permission from: Ellis MJ, Hayes DF, Lippman ME. Treatment of metastatic breast cancer. In: Diseases of the Breast, 2nd ed, Harris JR (Ed), Lippincott Williams &amp; Wilkins, Philadelphia 2000. Copyright &copy; 2000 Lippincott Williams &amp; Wilkins.",
"    </div>",
